function playAudio(base64Audio, times = 1) {
    let timesPlayed = 0;
    let audio = new Audio("data:audio/wav;base64," + base64Audio);
    audio.play();
}

function beep() {
    let base64Audio = "";
    this.playAudio(base64Audio);
}

function warningBeep() {
    let base64Audio = "";
    this.playAudio(base64Audio);
}

function errorBeep() {
    let base64Audio = "";
    this.playAudio(base64Audio);
}

export default {
    methods: {
        playAudio,
        beep,
        warningBeep,
        errorBeep,
    }
}
